    //         rideList: CheckedRideName()
    //     }).catch(err => console.log(err));
    // }


    // window.addEventListener('load', () => {
    //     CheckedRideName();
    //     CheckedStat();
    // })

    const data = [
        {						
            color: "steelblue", 
            points: [
                { x: 1, y: 64 },
                { x: 2, y: 61 },
                { x: 3, y: 64 },
                { x: 4, y: 62 },
            ]
        }
    ];
    var index = -1;
    {dataList.map((val, key) => {	
        if(val.ride_name) {
            console.log("Ride name = ", val.ride_name);
            if (!rideList.includes(val.ride_name)){
                rideList = rideList.push(val.ride_name)
              }
            index++;
        if(val.WaitTime >= 0){
        console.log("Wait Time = ", val.WaitTime)
        }
        if(val.Throughput >= 0) {
            console.log("Throughput = ", val.Throughput)
        }
